import React from "react";
import { Container, Row, Col, Card, CardHeader, CardBody, CardImg , Button} from "shards-react";

class Iniative extends React.Component{
  render() {
    return(
        <Container>

      <Row style={{ paddingTop: "10px" }}>

        <Col sm={{ size: 8, order: 2, offset: 2 }}>
          <Card> 
            <CardHeader><h3>Cyber Security Course for Beginners - Level 01 </h3></CardHeader>
            <CardImg top src="https://cdn.pixabay.com/photo/2015/07/17/22/43/student-849825_960_720.jpg" />
            <CardBody>
              <p>This is the body of the card.</p>
              <Button>Read more &rarr;</Button>

            </CardBody>
          </Card>
        </Col>

      </Row>
    </Container>

    )
  }
}

export default Iniative;
